import React from 'react';
import './Button.css';
import { Link } from 'react-router-dom';

export function Button() {
  return (
    <Link to='sign-up'>
      <input className='btn input' type='text' placeholder='Enter Your Work Email.'/>
      <button className='btn'>Get A Demo</button>
    </Link>
  );
}
